<script>
/**
 * GTM用ユーティリティ関数 (javascript)
 * 
 * [注意]
 * 1.下記を厳守しないと、一部環境(フロントエンドでscriptタグをパースしているような環境)で
 * エラーが出ます。(コードの改行が反映されず、コードがくっついた状態で解釈されるため)
 * 
 * ・コメントは、// は使わない
 * ・関数の行の最後にも、セミコロンを付与する
 * 
 * 2.必ずES5未満のコードを書いてください。(具体的には、GTMのタグのjavascriptでエラーが出ない内容が求められる)
 * */

/**
 GA用共通変数
 */
window.dmm_mkbase_ga_event_params = {
    user_id: '', /* ( DMMのオープンな会員ID。非ログイン時はカラ。) */
    common_last_login_user_id: '', /* ( cookie(cdp_id) ) */
    common_profile_id: '', /*( プロフィールID )*/
    common_layout: 'pc', /*( pc or sp ) */
    page_type: '' /* (top, floor_top, service_top, detail, etc...) */
}; 

/**GA用ユーティリティー関数
 dataLayerのオブジェクトに、タグAPIからの返却値を追加する関数。
 */
window.dmm_mkbase_ga_util = {
    merge_common_data: function (data) {
        /* 強制的にdatalayerをresetする */
        window.dataLayer.push({ 
            ecommerce: null,
            cloud_retail: null,
            via_info: null,
            via_option: null,
            via_view_rank: null,
            via_show_position: null,
            via_target_id: null,
            misc: null
        });

        /* 明示的なイベント発火か?をtrueにする */
        data['manual_fire_event'] = true;

        /* tracking-tag-api経由イベントを識別する */
        data['is_managed_by_tracking_tag_api'] = true;
        
        var event_name_prefix = 'mkbase_ga--';
        /* イベント名にprefixが含まれていない場合は、付与する */
        if(data['event'].indexOf(event_name_prefix) === -1){
            data['event'] = event_name_prefix + data['event'];
        }

        /* via情報の追加 */
        if (!(data.via_info || data.via_option || data.via_view_rank || data.via_show_position)) {
            var paramsString = window.location.search;
            var searchParams = new URLSearchParams(paramsString);
            data.via_info = searchParams.get('i3_ref');
            data.via_option = searchParams.get('dmmref');
            data.via_view_rank = searchParams.get('i3_ord');
            data.via_show_position = searchParams.get('i3_pst');
        }

        /* page_typeの更新（SPA対応） */
        if (data.page_type) {
            window.dmm_mkbase_ga_event_params.page_type = data.page_type
        }

        /* profile_idの更新（SPA対応） */
        if (data.common_profile_id) {
            window.dmm_mkbase_ga_event_params.common_profile_id = data.common_profile_id
        }

        /* cloud_retail存在しない場合のエラー回避 */
        if (data.cloud_retail === undefined || data.cloud_retail.productDetails === undefined) {
            return data;
        }

        /* cloud_retail内のecommerceパラメータを移行 */
        var items = [];
        var sum_price = 0;
        for (var i = 0; i < data.cloud_retail.productDetails.length; i++) {
            var _t = data.cloud_retail.productDetails[i];
            var item = {};

            if ('item_name' in _t.product) {
                item['item_name'] = _t.product.item_name;
            }
            if ('id' in _t.product) {
                var _id_tmp = "" + _t.product.id;
                /* 商品idにprefixが含まれていた場合は、GA4に送るIDからはprefixを除く */
                if (_id_tmp.indexOf("::::") > -1) {
                    var splited = _id_tmp.split("::::");
                    if (splited[1] && splited[1].length > 0) {
                        _id_tmp = splited[1];
                    }
                }
                item['item_id'] = _id_tmp;
            }
            if ('item_variant' in _t.product) {
                item['item_variant'] = _t.product.item_variant;
            }
            if ('priceInfo' in _t.product) {
                if ('price' in _t.product.priceInfo) {
                    item['price'] = _t.product.priceInfo.price;
                }
                if ('currencyCode' in _t.product.priceInfo) {
                    item['currency'] = _t.product.priceInfo.currencyCode;
                }
            }
            if ('affiliation' in _t.product) {
                item['affiliation'] = _t.product.affiliation;
            }
            if ('coupon' in _t.product) {
                item['coupon'] = _t.product.coupon;
            }
            if ('discount' in _t.product) {
                item['discount'] = _t.product.discount;
            }
            if ('index' in _t.product) {
                item['index'] = _t.product.index;
            }
            if ('item_brand' in _t.product) {
                item['item_brand'] = _t.product.item_brand;
            }
            if ('item_category' in _t.product) {
                item['item_category'] = _t.product.item_category;
            }
            if ('item_category2' in _t.product) {
                item['item_category2'] = _t.product.item_category2;
            }
            if ('item_category3' in _t.product) {
                item['item_category3'] = _t.product.item_category3;
            }
            if ('item_category4' in _t.product) {
                item['item_category4'] = _t.product.item_category4;
            }
            if ('item_category5' in _t.product) {
                item['item_category5'] = _t.product.item_category5;
            }
            if ('item_list_id' in _t.product) {
                item['item_list_id'] = _t.product.item_list_id;
            }
            if ('item_list_name' in _t.product) {
                item['item_list_name'] = _t.product.item_list_name;
            }

            if ('promotion_id' in _t.product) {
                item['promotion_id'] = _t.product.promotion_id;
            }

            if ('quantity' in _t) {
                item['quantity'] = _t.quantity;
            }

            items.push(item);

            /* cloud_retail非対応パラメータの削除 */
            delete data.cloud_retail.productDetails[i].product.item_name;
            delete data.cloud_retail.productDetails[i].product.item_variant;
            delete data.cloud_retail.productDetails[i].product.affiliation;
            delete data.cloud_retail.productDetails[i].product.coupon;
            delete data.cloud_retail.productDetails[i].product.discount;
            delete data.cloud_retail.productDetails[i].product.index;
            delete data.cloud_retail.productDetails[i].product.item_brand;
            delete data.cloud_retail.productDetails[i].product.item_category;
            delete data.cloud_retail.productDetails[i].product.item_category2;
            delete data.cloud_retail.productDetails[i].product.item_category3;
            delete data.cloud_retail.productDetails[i].product.item_category4;
            delete data.cloud_retail.productDetails[i].product.item_category5;
            delete data.cloud_retail.productDetails[i].product.item_list_id;
            delete data.cloud_retail.productDetails[i].product.item_list_name;
            delete data.cloud_retail.productDetails[i].product.promotion_id;
        }

        if (!("ecommerce" in data)){ data.ecommerce = {}; }
        data.ecommerce.items = items;

        /* valueが無ければ追加 */
        if (!("value" in data.ecommerce) && items.length > 0) {
            data.ecommerce.value = sum_price;
        }

        return data;
    }
};
